import React from "react";

function createDictionary(emojipedia){
  return(
    <Entry 
      id={emojipedia.id}
      key={emojipedia.id}
      name={emojipedia.name}
      meaning={emojipedia.meaning}
    />
  );
}

function Entry(){

  {emojipedia.map(createDictionary)}
  return    
}


export default Entry;
